  document.querySelectorAll('.gustavus-wrapper').forEach(function (wrapper) {
    var FRAME_DURATION = 200;
    var INTERSECTION_THRESHOLD = 0.66;
    var frame = 1;
    var images = wrapper.querySelectorAll('img.desktop');
    images[frame - 1].style.opacity = 1;
    var interval = null;
    var started = false;
    var stopAnimation = function stopAnimation() {
      return clearInterval(interval);
    };
    var startAnimation = function startAnimation() {
      if (started) return;
      started = true;
      interval = setInterval(function () {
        var currentFrame = frame;
        if (frame == images.length) {
          // Only play animation once
          return stopAnimation();
        } else {
          // Increment frame
          frame += 1;
        }

        // Hide current frame
        images[currentFrame - 1].style.opacity = 0;
        // Show new frame
        images[frame - 1].style.opacity = 1;
      }, FRAME_DURATION);
    };
    var observer = new IntersectionObserver(function (entries, observer) {
      entries.forEach(function (entry) {
        if (!entry.isIntersecting) return;
        console.log('Triggering Gustavus');
        startAnimation();
      });
    }, {
      rootMargin: '0px',
      threshold: INTERSECTION_THRESHOLD
    });
    observer.observe(wrapper);
  });
